mapper.select:
     SELECT
        DbT7022ShoriDateKanri.*
        FROM
        () AS DbT7022ShoriDateKanri
        WHERE
	    DbT7022ShoriDateKanri."dbT7022ShoriDateKanri_subGyomuCode" = #{サブ業務コード}   
	AND DbT7022ShoriDateKanri."dbT7022ShoriDateKanri_shichosonCode" = #{市町村コード}   
	AND DbT7022ShoriDateKanri."dbT7022ShoriDateKanri_shoriName" = #{処理名}  
	AND DbT7022ShoriDateKanri."dbT7022ShoriDateKanri_shoriEdaban"  = #{処理枝番}   
	AND DbT7022ShoriDateKanri."dbT7022ShoriDateKanri_nendo" = #{年度}  
	AND DbT7022ShoriDateKanri."dbT7022ShoriDateKanri_nendoNaiRenban" = #{年度内連番}
